import './App.css';
import UserLogin from "./components/userLogin";
import Register from "./components/register"
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<UserLogin/>} />
        <Route path='/register' element ={<Register/>} />
      </Routes>
    </div>
  );
}
export default App;
